const CACHE_NAME="maximelroy-carte-v1";self.addEventListener("install",(t=>{t.waitUntil((async()=>{(await caches.open(CACHE_NAME)).addAll(["./","./styles/styles.min.css","./fonts/Rubik.woff2","./manifest.json","./favicon.ico","./icon512.png"])})())})),self.addEventListener("fetch",(t=>{t.respondWith((async()=>{const e=await caches.open(CACHE_NAME),s=await e.match(t.request);if(s)return s;try{const s=await fetch(t.request);return e.put(t.request,s.clone()),s}catch(t){}})())}));